import React from 'react';

function TodoList() {


    const submit =(event)=>{
        event.preventDefault();
    }
  return (
      <>
      <div className='todoapp'>
        <form onSubmit={submit}>
            <input type="text" />
            <button type="submit">submit</button>
        </form>
      </div>
      </>
  );
}

export default TodoList;
